import React, { useState } from "react";
import classes from './Auth.module.css';

function Auth(props) {

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    return (
        <div className={classes.main}>
            <form className={classes.mainform}>
                <div className={classes.form_control}>
                <label className={classes.form_control_label}>Email</label>
                <input type='text' value={email} className={classes.form_input} placeholder="Email"/>
                </div>
                <div className={classes.form_control}>
                <label className={classes.form_control_label}>Password</label>
                <input type='password' value={password} className={classes.form_input} placeholder="Password"/>
                </div>
                <div className={classes.form_control_button}>
                    <button className={classes.button}>Submit</button>
                    <button className={classes.button}>Sign Up</button>
                </div>
            </form>
        </div>
    )
}

export default Auth;
